import styled from "styled-components";

const RegisterPage = () => {
  return (
    <Container>
      <Wrapper>
        <Title>CREATE AN ACCOUNT</Title>
        <Form>
          <Input placeholder="name" />
        </Form>
      </Wrapper>
    </Container>
  );
};

export default RegisterPage;
